{"language":"Solidity","sources":{"contracts/mysmartcontract.sol":{"content":"pragma solidity ^0.8.0;

contract SupplyChain {
    struct Product {
        uint id;
        string name;
        uint quantity;
    }

    struct Transaction {
        uint productId;
        uint quantity;
        string action; // "import" or "export"
        uint timestamp;
    }

    mapping(uint => Product) public products;
    mapping(uint => Transaction[]) public productTransactions;
    uint public productCount;

    event ProductAdded(uint productId, string name, uint quantity);
    event ProductUpdated(uint productId, string name, uint quantity);
    event TransactionRecorded(uint productId, uint quantity, string action, uint timestamp);

    function addProduct(string memory name, uint quantity) public {
        productCount++;
        products[productCount] = Product(productCount, name, quantity);
        
        emit ProductAdded(productCount, name, quantity);
    }

    function updateProduct(uint id, uint quantity, string memory action) public {
        Product storage product = products[id];
        if (keccak256(abi.encodePacked(action)) == keccak256(abi.encodePacked("import"))) {
            product.quantity += quantity;
        } else if (keccak256(abi.encodePacked(action)) == keccak256(abi.encodePacked("export"))) {
            require(product.quantity >= quantity, "Insufficient stock");
            product.quantity -= quantity;
        }
        
        // Lưu lại lịch sử giao dịch
        productTransactions[id].push(Transaction(id, quantity, action, block.timestamp));
        
        emit ProductUpdated(id, product.name, product.quantity);
        emit TransactionRecorded(id, quantity, action, block.timestamp);
    }

    function getProduct(uint id) public view returns (string memory name, uint quantity) {
        Product memory product = products[id];
        return (product.name, product.quantity);
    }

    function getProductTransactions(uint id) public view returns (Transaction[] memory) {
        return productTransactions[id];
    }
}
